INSERT INTO `blog` (`id`, `title`, `short_description`, `description`, `user_id`, `created_at`, `updated_at`) VALUES
(16, 'G is for Google', 'As Sergey and I wrote in the original founders letter 11 years ago, “Google is not a conventional company. We do not intend to become one.” As part of that, we also said that you could expect us to make “smaller bets in areas that might seem very speculative or even strange when compared to our current businesses.” From the start, we’ve always strived to do more, and to do important and meaningful things with the resources we have. ', 'What is Alphabet? Alphabet is mostly a collection of companies. The largest of which, of course, is Google. This newer Google is a bit slimmed down, with the companies that are pretty far afield of our main Internet products contained in Alphabet instead. What do we mean by far afield? Good examples are our health efforts: Life Sciences (that works on the glucose-sensing contact lens),', 43, '2015-08-13 07:36:52', '2015-08-13 07:36:52'),
(17, 'Zane Lowe Discusses Beats 1, Meeting Dr. Dre, Moving to Los Angeles and More', 'Just over six weeks after the launch of Apple Music, Billboard has published a wide-ranging interview with lead radio DJ Zane Lowe, in which he talks about Beats 1, collaborating with Dr. Dre and Trent Reznor, familiarizing himself with American radio stations, moving to Los Angeles from London and a number of other topics. ', 'Lowe reflected on the first weeks of Beats 1, noting that the personality of the radio station is still developing, with no particular emphasis on which music genres are played. Electronic, alternative rock and hip-hop have been some of the most popular genres on Beats 1 so far, but Lowe ensured there are no set parameters for music.\r\nThere’s a lot of electronic music, edgy rock and hip-hop on Beats 1. Are there set genres you’re pursuing? \r\nNo, not really. We’ve played country music, Mexican house music, South American EDM, German hip-hop. I’ve never been a fan of, “We’ve got to get 22 percent of rock, 17 percent of R&B; where’s our 16 percent of hip-hop and our 9 percent of country?” If you do it that way, you’re not basing it on the merit of the music. You’re basing it on some kind of obligation. ', 40, '2015-08-16 23:31:48', '2015-08-16 23:31:48'),
(18, 'iOS 9 (What''s Coming)', 'iOS 9 is Apple''s newest operating system for iOS devices like the iPhone and the iPad, introduced at the Worldwide Developers Conference on June 8. iOS 9 builds on the content introduced with iOS 7 and iOS 8, bringing subtle design changes, refined features, improved functionality, and performance enhancements.', 'iOS 9''s biggest focus is on intelligence and proactivity, allowing iOS devices to learn user habits and act on that information, opening up apps before we need them, making recommendations on places we might like, and guiding us through our daily lives to make sure we''re where we need to be at the right time.\r\n\r\nSiri is at the heart of the changes, and the personal assistant is now able to create contextual reminders and search through photos and videos in new ways. Swiping left from the home screen also brings up a new screen that houses "Siri Suggestions," putting favorite contacts and apps right at your fingertips, along with nearby restaurant and location information and important news.', 40, '2015-08-16 23:32:54', '2015-08-16 23:32:54'),
(19, 'How to Block Stolen / Lost Mobile Phone in Pakistan', 'Mobile theft is nothing new when it comes to Pakistan. Mobile theft and snatching is getting common with every passing day. If you are one of those who got their mobile either snatched or stolen, it is natural that you would wish that if you cannot use your mobile, no one else should do it as well.', 'Here is the solution to your problem. First of all when you buy a new mobile, dial the number *#06# and you will get a number. This number is known as IMEI number of your mobile set. IMEI number is unique in every GSM mobile set. It can also be found underneath the battery of your mobile or on the warranty card as well. If you don’t find it underneath the battery or on warranty card, just dial *#06# and you will have the IMEI number. Note down this number with you and keep it safe.\r\nIn case your mobile set is stolen or lost, you can use IMEI number to block the phone set\r\nCPLC (Citizen Police Liaison Committee) 021-35662222\r\nPolice (Rescue 15) 15\r\nPTA (Pakistan Telecommunication Authority) 0800-25625\r\nThey will ask you to provide them with some basic information along with IMEI number of your lost or theft mobile set.\r\nOnline complaints can be registered at http://www.cplc.org.pk/theft_form.php', 40, '2015-08-16 23:35:47', '2015-08-16 23:35:47'),
(20, 'Facebook will let you buy products from retailers'' Pages', 'You''ll soon be able to buy a lot more stuff on Facebook.\r\n\r\nThe social network is testing a shopping experience that allows users to buy items directly from business'' Facebook pages. The new shopping feature, first reported by BuzzFeed, will allow retailers to turn their Facebook pages into mini storefronts outside of their main websites.\r\n\r\nFacebook confirmed the new shopping features to Mashable Wednesday, saying it''s currently being tested among a small number of users and a handful of retail and e-commerce companies.', 'On mobile, the shopping features will appear in a new "shopping" section on the page, as pictured in the mockup image, below, while on desktop the shopping section will appear as a separate tab on the page in the same area where the Timeline, About, Photos and other tabs are currently located.\r\n\r\nIn the shopping section, companies will show off products in a format that appears to be similar to the way photos are laid out. If you want to buy one of the products, the retailers will be able to choose whether the actual transaction will take place within Facebook or whether you''ll be redirected to the company''s website.', 42, '2015-08-16 23:39:10', '2015-08-16 23:39:10'),
(21, 'How to keep technology from mocking your broken heart', 'After 16 years of marriage, the text from Lisa Arends’ husband read: “I’m sorry to be such a coward leaving you this way but I’m leaving you and leaving the state.”\r\n\r\nShe collapsed to the floor. And never received any communication from him again.\r\n\r\nBut their digital interactions haunted her in a way she never could have imagined. With linked email accounts, she saw in his junk email that he had failed to pay the tab on the cost of a band — for his recent wedding.', 'Arends’ extraordinary story is, of course, on the very extreme end of the digital heartbreak spectrum, but the technological echo of a past lover is something many people understand far too well.\r\n\r\n“We have never been more connected to each other than we are in 2015, and yet it seems that the trend of ‘ghosting’ as a way of backing out of a relationship is increasingly popular,” says tech consultant Amanda Blum of Howling Zoe.', 42, '2015-08-16 23:39:47', '2015-08-16 23:39:47'),
(22, 'Samsung Gear S2 smartwatch makes its fashion debut', 'Just a day after teasing its upcoming smartwatch at its Unpacked event, Samsung''s Gear S2 wearable has appeared beside alien-like models in its first photo shoot.\r\n\r\nThe watch looks great, and even shows up with both a white band and a black band. It''s not yet clear if the bands will be interchangeable, like the Apple Watch, but hey, this is Samsung, so it wouldn''t be a surprise.', 'Also featured prominently are the two Samsung phones of the hour, the Galaxy Note 5 and the Galaxy S6 Edge+. The two phablet-size phones were given the same fashion-focused treatment the Gear S2 got.\r\n\r\nhere have been rumors abound about the company''s next wearable, which looks to be a big departure from all of its previous smartwatches. Samsung''s done away with rectangle shaped screens on earlier Gear watches, going with a round screen instead. The metal bezel around the screen will may be rotatable to navigate the interface, if recent rumors are to be believed.\r\n\r\n\r\n\r\nThough full details are expected at the IFA consumer electronics trade show in Berlin, the glimpse we got at the interface during the Unpacked event seems to confirm that the watch won''t run Android Wear. Instead, it''s likely that the watch will run Tizen, Samsung''s homegrown mobile operating system. That means the watch will likely be compatible only with Samsung phones.', 42, '2015-08-16 23:40:25', '2015-08-16 23:40:25'),
(23, 'Periscope claims 10 million accounts as live-streaming apps heat up', 'Twitter''s entry into the live mobile streaming game appears to be paying off, as the company has announced that Periscope currently has 10 million registered accounts.\r\n\r\nAnd while those 10 million accounts, registered on both iOS and Android devices, don''t indicate that the service has 10 million "users" (many could be one-and-done, dormant accounts), the number is nevertheless a healthy early signal that, four months post launch, Periscope was probably a wise bet for Twitter.', 'The new numbers were laid out in a message from the company on Wednesday, in which we also learned that Periscope users are watching the equivalent of "40 years of video per day."\r\n\r\nWhen the short messaging company acquired Periscope back in March the service was going up against Meerkat, which reportedly had around 60,000 users at the time. A subsequent report, just weeks later, had Meerkat''s user numbers at 300,000 users.\r\n\r\nBut that''s all ancient history. Twitter''s crackdown on Meerkat''s access to it social graph, along with Periscope''s native infrastructure advantage, quickly rocketed Periscope to popularity.\r\n\r\nIn short order, Periscope snagged one million users, just 10 days after its launch. Since then, the once blazing-hot live-streaming app Meerkat has largely been quiet in terms of user chatter on Twitter (at least compared its beginnings).\r\n\r\n', 42, '2015-08-16 23:41:18', '2015-08-16 23:41:18'),
(24, '3 ways to help you find meaning in a job that you hate', 'If you read one more article on happiness in the workplace, you''re going to lose it.\r\n\r\nFor you, it''s different. You need to continue in your current job because your spouse is still in school, you''re building the skills you need to move to the next level, or you want to make a dent in that mountainous student loan debt. Eventually, you''ll start searching for a job you love — but right now, you''re stuck.', 'For now, getting through each day is a battle: work that isn''t interesting, co-workers who make you batty, a boss who doesn''t seem to have a clue how to manage people. All this advice about being happy at work seems like a big fat pile of bull hockey that simply doesn''t apply to you.\r\n\r\nSound familiar?\r\n\r\nIf so, I have some good news. Yes, happiness is one form of life satisfaction — but finding meaning is another.\r\n\r\nSometimes, we assume that finding meaning is all about saving the world, feeding the hungry, or housing the homeless. But it''s not limited to that. Psychologist Todd Hall defines meaningful work as "work that contributes to the well-being of others in a way that uniquely expresses and defines who we are."', 42, '2015-08-16 23:41:41', '2015-08-16 23:41:41'),
(25, 'World''s best dad builds ''Star Wars'' speeder bike as rocking horse', 'Australian man Tez Gelmir is not going to let his daughter grow up without knowing the wonders of Star Wars.\r\n\r\n', 'For her first birthday, he built her a rocker in the form of the speeder Princess Leia rides to evade the Scout Troopers in Episode VI: Return of the Jedi using only plywood, a 3D-printed hull and some electronics for the lights and sounds.\r\n\r\nIf you''d like to do the same for your young padawans, Gelmir has added a how-to on Instructables.\r\n\r\nYou know she''s going to grow up to be an avid Star Wars fan — just look at that smile and Princess Leia head wear.', 43, '2015-08-16 23:42:48', '2015-08-16 23:42:48'),
(26, 'Report: Apple Pay is hitting a wall with Australian banks', 'Apple Pay, Apple''s first foray into mobile payments, was announced by the technology heavyweight in September last year, but its global roll out hasn''t been all smooth sailing.\r\n\r\nIt ran into multiple problems on the London Tube after its UK introduction, while take up in the U.S. seems to be a little slow, and now the company is reportedly in a stand-off with the major Australian banks.', 'Apple Pay enables contactless purchases via an iPhone or Apple Watch at supported merchants. It launched in the U.S. in October 2014 with support from credit card companies Visa, MasterCard and American Express, as well as in the UK in July 2015.\r\n\r\nTo work, however, the platform needs a deal with the bank that issued the credit card — and that''s where Australia''s big four banks are holding up progress, according to Fairfax Media.\r\n\r\nThe fight between Australia''s big banks and Apple is reportedly concentrated mostly on fees. Australian banks earn around A$2 billion in interchange fees each year, which merchants pay in order to use the bank''s payment infrastructure, and they''re reportedly unwilling to give up a portion of the pool to Apple. Interchange fees in Australia are already lower than in America, and so allowing Apple to take a cut is a hit they''re so far unwilling to take.\r\n ', 43, '2015-08-16 23:43:17', '2015-08-16 23:43:17'),
